import { Injectable } from "@angular/core";
import { Observable, fromEvent, map } from "rxjs";

@Injectable({
  providedIn: 'root'
})
export class MinigameParkingjamImagesService {
  private images: Map<string, any> = new Map();
  private imageContent: Map<string, string> = new Map();

  constructor() {
    this.createContent();
    this.loadImages();
  }

  getImageForCar(name: string): Observable<any> {
    return this.images.get(name);
  }

  private loadImages(): void {
    this.imageContent.forEach((value, key) => {
      let image = new Image();
      let observable = fromEvent(image, 'load')
        .pipe(map(() => image));
      this.images.set(key, observable);
      image.src = value;
    });
  }

  private createContent() {
    this.imageContent.set('2x1-red-car-bottom-up.png', 'data:image/png;base64,');
    this.imageContent.set('2x1-red-car-top-down.png', 'data:image/png;base64,');
    this.imageContent.set('1x2-red-car-left-right.png', 'data:image/png;base64,');
    this.imageContent.set('1x2-red-car-right-left.png', 'data:image/png;base64,');

    this.imageContent.set('3x1-blue-truck-bottom-up.png', 'data:image/png;base64,');
    this.imageContent.set('3x1-blue-truck-top-down.png', 'data:image/png;base64,');
    this.imageContent.set('1x3-blue-truck-left-right.png', 'data:image/png;base64,');
    this.imageContent.set('1x3-blue-truck-right-left.png', 'data:image/png;base64,');

    this.imageContent.set('1x2-green-truck-left-right.png', 'data:image/png;base64,');
    this.imageContent.set('1x2-green-truck-right-left.png', 'data:image/png;base64,');
    this.imageContent.set('2x1-green-truck-bottom-up.png', 'data:image/png;base64,');
    this.imageContent.set('2x1-green-truck-top-down.png', 'data:image/png;base64,');

    this.imageContent.set('3x1-red-car-bottom-up.png', 'data:image/png;base64,');
    this.imageContent.set('3x1-red-car-top-down.png', 'data:image/png;base64,');
    this.imageContent.set('1x3-red-car-left-right.png', 'data:image/png;base64,');
    this.imageContent.set('1x3-red-car-right-left.png', 'data:image/png;base64,');
  }
}